import React from 'react';
import { useNavigate } from 'react-router-dom';
import invitadoImg from '../imagenes/logoooo.png'; // Cambia la ruta según corresponda
import loginImg from '../imagenes/logoooo.png'; // Cambia la ruta según corresponda

const Inicio = () => {
    const navigate = useNavigate();

    const handleInvitado = () => {
        navigate('/Lugares'); // Cambia a la ruta deseada
    };

    const handleIniciarSesion = () => {
        navigate('/Ingreso'); // Cambia a la ruta de inicio de sesión
    };

    return (
        <div className="inicio-container">
            <div className="button-container">
                <div className="button-wrapper">
                    <img src={invitadoImg} alt="Invitado" className="button-image" />
                    <button onClick={handleInvitado}>Seguir como invitado</button>
                </div>
                <div className="button-wrapper">
                    <img src={loginImg} alt="Iniciar Sesión" className="button-image" />
                    <button onClick={handleIniciarSesion}>Iniciar sesión</button>
                </div>
            </div>
        </div>
    );
};

export default Inicio;
